	[character]
	_addr="0x1ea79a00"
	current_frame="normal"
	custom="yes"
	face_right="yes"
	label="_1be301c2"
	on_talk="if(vars.talked,
	           [  speech_dialog(self, [~Enjoy your trip on the CONVEYANCE!\nJust don't let the bugs scare you off!~]) ],
	
	           [ speech_dialog(		self,			[~Hi there, sonny!~],
	           										[~Have you come here\nto ride on the CONVEYANCE?~],
	              									set(level.player.animation, 'emote_confused'),
			   						level.player,	[~Uhh...\nWill this get me across the river?~],
			   						self, 			[~Sure thing it will!~],
			   										[~In fact, since it's the only way at\nthe moment, I'm doing a public service\nby making it free.~],
	           		   								set(level.player.animation, 'emote_talk'),
			   						level.player,	[~That's nice.~],	
			   						self,			[~Yessir, climb aboard the CONVEYANCE\nfor the ride of your life!~],
	              									set(level.player.animation, 'emote_confused'),
			   						level.player,	[~Wha...\nWhat's up with this 'carnival' act?~],	
	              									set(level.player.animation, 'emote_geez'),
			   										[~Are you some kind of amateur showman?~],
			   						self, 			[~Ho!\nNot at all, not at all.~],
			   										[~You see, my family has passed down\na long-standing trade.~],
			   										[~We build rides for amusment parks!~],
	              									set(level.player.animation, 'emote_oh'),
			   						level.player,	[~..oh god, please no.~],
			   						self, 			[~That's right!\nWe wouldn't just build a bridge -\nnot without some of\nour trademark EXCITEMENT!~],
			   						level.player,	[~...~],
	              									set(level.player.animation, 'emote_raisedfinger'),
			   						level.player,	[~With all due respect, sir...\nI think you're insane.~],
				                    self,			[~Ha! They said my grandfather\nwas crazy, when he built it.~],
				                    				[~But who's crazy now, eh?~]),
			   set(level.zoom, 1),
			   set(vars.talked, 1)
			   ])"
	time_in_frame="0"
	type="runglesnik_npc"
